import Layout from '../../components/Layout';

const Admin = () => {
  return (
    <Layout>
      {' '}
      <div className="container">
        <div className="page-title"> Add Product </div>
      </div>{' '}
      <style jsx>{`
        .container {
          max-width: 120rem;
          margin: 3rem auto;
        }
        .page-title {
          font-size: 3rem;
        }
      `}</style>{' '}
    </Layout>
  );
};

export default Admin;
